import React from 'react'

function Soft() {
      return (
            <div className="wrapper-soft">
                  <div className="soft1-grid">SOFT SKILLS</div>
                  <div className="soft2-grid">
                  <strong>PROFESSIONAL INTEGRITY AND HONESTY: </strong>
                        <p>Integrity, uprightness and honest attitude can help the business achieve long term goals.</p>
                  </div>
            </div>
      )
}
export default Soft
